package com.demo.rajasekhar.io.stream;

import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;

public class Mutipuleimages {
	public static void main(String[] args) {
		String [] byteBinaryData = getByteBinaryData();
		String path = "rajresources/images/image{img}.jpg";
		for(int i=0;i<byteBinaryData.length;i++) {
			String filePath = path.replace("{img}",String.valueOf(i));
			try (FileOutputStream fo = new FileOutputStream(filePath)) {
				byte [] image = Base64.getDecoder().decode(byteBinaryData[i]);
				fo.write(image);
				System.out.println("Image updated Succesfully");
			} catch (IOException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
		}

	}

	private static String[] getByteBinaryData() {
		String [] Arr1 = new String[2];
		Arr1[0] = "";
		Arr1[1] = "";
		return Arr1;
	}
}
